import React from "react";
import { Form } from "react-bootstrap";
import "./TweetForm.css";

function TweetForm() {
  return (
    <div >
      <Form.Group controlId="exampleForm.ControlTextarea1">
        <Form.Control
          as="textarea"
          rows={5}
          cols={45}
          placeholder="What's on your mind..."
          className="w-100"
        />
      </Form.Group>
    </div>
  );
}
export default TweetForm;
